import { Card } from 'antd';

import "./subs.css"
const { Meta } = Card;

function Cards(props) {
  
  return <>
  
  <Card
    hoverable
    style={{
      width: 280,
      background:`${props.color}`
      
    }}
    cover={
      <img alt="example" className='cards' src={props.img} />
    }
  >
    <button onClick={()=>{navigate('/Subscription')}}>Subscribe to know more</button>
  </Card>
  </>
};
export default Cards;
